INSERT INTO `subsubtopic` (`id`, `title`, `mid`, `sid`, `desc`) VALUES
(1, 'The Beauty Diet', 1, 8, 'The beauty diet is an eating plan that promises to help your skin look more youthful and more beautiful. Rather than relying on expensive creams and treatments, the Beauty Diet promotes using whole foods as your natural beauty enhancer.'),
(2, 'Super healthy Skin:', 1, 8, 'Our skin is the largest organ of our body, and keeping it healthy is super important. Make sure that your skin is the best it can be. The expression \'you are what you eat\' may be more accurate than you think. There are many factors that contribute to the clear, glowing, blemish-free skin everyone strives for (including genetics). Some foods—depending on their vitamin, mineral, and antioxidant content—can actually help promote healthy skin.'),
(3, 'Body Care recipes', 1, 8, 'If you have sensitive skin then you\'ve probably found mainstream cosmetic products to be a risky proposition. All those harsh chemicals and unnatural ingredients can wreak havoc on your complexion and your confidence. In body care recipes, you\'ll find a number of ways to keep yourself naturally beautiful.'),
(4, 'Cosmetic chemistry', 1, 8, 'Are you convinced it is no longer possible for you to build a nearly unbreakable, high performance, lean and vibrant body and spirt and rejuvenate your outlook on your over 50 future? Most personal trainers are in their 20\'s, 30\'s and early 40\'s. You need someone who can not only relate to you, but can also provide you with an easy-to-use and proven prescription to become a lean, fat-incincerating, anti-aging over-50 and beyond wellness machine! The second half century of your life can become the most thrilling, fit, healthy and well years you could have ever imagined. Get \'50FIT\' and learn how you can start looking and feeling better than you have in decades!'),
