(73, 'Bulletproof Body', 1, 24, 'Total-body strength training opens a New Window is a requisite in any decent exercise program. Strength training not only increases muscle mass (which is a great shock absorber when you\'re running, jumping, or getting slammed by left tackle), but it spurs bone growth, improves joint stability and mobility, and wards off potentially side-lining muscle imbalances Opens a New Window.'),
(74, 'Naked Beauty', 1, 25, 'Are you tired of wasting money on ineffective cellulite treatments? Phony lotions, skin-brushing, painful treatments, body-wrapping and toxin-flushing pill scams don\'t work! Learn the secret to a simple 22-minute cellulite reducing method that has empowered hundreds of women to reclaim their natural beauty and self esteem. Learn the subtle moves to wipe-out cellulite without weights, machines, useless gadets and NO changes in diet.'),
(75, 'Truth about Cellulite', 1, 25, 'Learn to beat the plague of cellulite for once and all. The Truth About Cellulite system teaches you everything you need to know to conquer weight loss and beat cellulite with scientifically proven methods. Also, through diet and fitness routines that will lead you to a healthier, more vibrant you.'),
(76, 'Save the Marriage System', 2, 13, 'Whether you and your partner have suffered through affairs, bankruptcies, dishonesty, deception or mid-life crises, it is still possible to avoid divorce and transform your marriage into something fantastic. Say goodbye bickering and sleeping on the couch and prepare yourself to rediscover your soulmate. Take action now and create the marriage and relationship of your dreams.'),
(77, 'Lovetraction Lines', 2, 13, 'Do you want to learn the one bizarre, unusual phrase that will make any man burn with curiosity and attraction for you? Make him go crazy in as little as five minutes with this simple formula! Stop waiting for him to notice you. Instead, MAKE him notice you with the exact right phrase. This secret \'Love Spell\' may sound too good to be true, but it\'s the exact words you need to make men fight over you.'),
(78, 'What Men Secretly Want', 2, 13, 'This is a course for women who want to find and keep high quality men to settle down with. It\'s for you if you want to find \'the one\' or simply want the companionship and deep emotional connection that comes with having a committed relationship.'),
(79, 'What women secretly want', 2, 13, 'We decided to take a different approach in getting men to understand by creating the ultimate women&#39;s wish list (that we hope will make things easier for man and womankind).'),
(80, 'Text that Girl', 2, 14, 'You meet your dream girl, you get her number, and you go to send her a text…but, then what? You\'re stumped. You can\'t screw it up now, you have to send her the right text to prove yourself. Whether you\'re not sure how to ask her out, she keeps flaking or you feel like she\'s stringing you along, this product will teach you how to recover and build her attraction for you. The truth is there are other guys\' texting this same girl, let us show you how to stand out and make her choose you.'),
(81, 'The Women Men Adore', 2, 14, 'Tap into every man\'s unconscious desires and never be lonely again. It can be hard for women today to understand what men want, because most men don’t even know what they are looking for. While men may say they want a woman that is laid back and easygoing, research suggests that in order to stay committed a man actually needs the exact opposite. No matter what size, shape or age you are, this guide will give you the information needed to capture his heart.'),
(82, 'Make Small Talk Sexy', 2, 14, 'Does your mind go blank when talking to a woman? Are you seen as more shy and boring than you are charismatic and free flowing? Are you ready to learn some James Bond level smoothness? Make Small Talk Sexy will teach you smooth transitions, what to say next, how to recover from conversations lulls and most importantly how to escalate your conversations to something playful and fun.'),
(83, 'Make Him Desire You', 2, 14, 'Have an edge over 99% of women with this secret manual to make any man desire you. Imagine every man tripping over himself and doing everything in his power to be yours, as men will quickly become addicted to you. Start following the manual and start seeing results immediately, see how rapidly men will do anything to be with you. What woman doesn’t want to be desired?'),
(84, 'Emotional Hook Formula', 2, 14, 'Did you know that there\'s a weird \'mind twist\' that you can use on any man to make him instantly drool over you? Are you tired of waiting around for Mr. Right when you could hook him the second he lays eyes on you with this incredible formula? Discover the Emotional Hook Formula today and make him yours.'),
(85, 'Capture His Heart:', 2, 14, 'There\'s a psychological loophole in the male mind that nearly no one knows about. But this loophole can make any man fall deeply, irreversibly in love with you and only you. Michael Fiore, internationally known relationship expert, discovered this trick when it was used on him by the woman he is now in a relationship with. Learn exactly how to make him fall absolutely in love with you with 3 Steps to Make a Man Love You.'),
(86, 'Break Free', 2, 15, 'To escape from an unpleasant person or situation that controls your life. Escape from the mental prison. To &quot;break free&quot; also means to make yourself free from forces that stop/prevent you from being what you want to be.'),
(87, 'Relationship Expert', 2, 15, 'A relationship expert is someone who understands human needs and desires within the context of the way we feel, interact, connect and behave with ourselves and others; someone whom has the solution, techniques and strategies to achieve the desired outcomes in relationships.'),
(88, 'Get your guy/girl back', 2, 15, 'Want to know the strangest thing about getting your ex back? Actually getting him back isn\'t that hard. With a couple tricks, it\'s actually really easy. The tricky part is actually KEEPING him once he\'s back. Know the tricks.'),
(89, 'Get rid of abusive relationships', 2, 15, 'Abuse can take a variety of forms, but both mental and physical abuse need to be addressed swiftly and safely. If you&#39;re in an abusive relationship, you need to take immediate action to preserve your own well-being and find the road to your recovery. Plan a proper end to your abusive relationship, keep yourself safe.'),
(90, 'How to catch a cheater', 2, 15, 'How can I find out if my husband or wife, boyfriend or girlfriend is cheating on me? It can be very difficult to catch a cheating spouse. Understandably, most people do not know how to investigate a spouse. A lot of tips, resources and advice that will help you discover the truth can be found.'),
(91, 'How to fix a relationship', 2, 15, 'When relationships are broken, or venture upon rocky seas, there comes a time when a person must decide if the union is important enough to work on mending the relationship.'),
(92, 'Life after breakups', 2, 16, 'You fought to hold on to the relationship to the point of being all- consumed. You don\'t want to believe it\'s actually ending. You can\'t believe it. Even if the relationship was awful, even unbearable at times, the idea of living without it is unacceptable. Still, it\'s becoming clear that the two of you aren\'t going to make it.'),
(93, 'How to feel better after a breakup', 2, 16, 'Want to know how to feel better after a breakup? But just can\'t get those thoughts of your ex out of your mind? If you want to know how to feel better after a breakup, it\'s important to step back and take a look at the relationship and why the break up is hurting so much. So let’s do just that…'),
(94, 'How to avoid contact after breakup', 2, 16, 'No Contact, how it should be done, its benefits, and what you should and should not do if you decide to exercise it. The advice here can be effective for people who were dumped, or for those who initiated the breakup.'),
(95, 'How to heal my broken heart', 2, 16, 'Break up. Split up. Separate. Divorce. Those verbs have pretty powerful, dramatic weight. They are vivid and active. They do damage—especially to the heart. A broken heart feels heavy, laden with sadness and fear, but a broken heart can heal. There is hope.'),
(96, 'Second chance', 2, 16, 'Anyone who says their relationship is easy and perfect and they never fight is either lying, or in deep denial. Healthy couples fight. And many times, the same issues you\'re having in your relationship will come up again in the next one.'),
(97, 'Nice Guy Coach', 2, 17, 'Do nice things for women hoping they will be attracted to them. Strive to lead a smooth, problem-free life. Think that any kind of tension or conflict is bad. Are afraid to express themselves for fear of being rejected. Frequently get stuck in procrastination and perfectionism . Does this sound like you? Get the help you need to get what you want in dating, relationships, career. And life. \'Courage is not the absence of fear, but rather the judgment that something else is more important.\''),
(98, 'How to get a man to be your boyfriend', 2, 17, 'Show More I&#39;ve never been so confused in my whole entire life. Nobody understands, they never have, they never will. Not now, not ever. Do you feel the same?'),
(99, 'Get the guy', 2, 17, 'It reveals the secrets of the male mind and the fundamentals of dating and mating for a proven, revolutionary approach to help women to find lasting love.'),
(100, 'Get the girl', 2, 17, 'It reveals the secrets of the female mind and the fundamentals of dating and mating for a proven, revolutionary approach to help men to find lasting love.'),
(101, 'Online Dating', 2, 17, 'Creating a dating profile can be scary. After all, it\'s not always easy to big yourself up without sounding conceited or (even worse) desperate. But did you know that one in three couples now find love online?'),
(102, 'Communication', 2, 17, 'There are six fundamental needs that all humans share and each of us puts these needs in a different order in accordance with our core values. Once you discover which needs matter the most to your partner, you\'ll know how to communicate in a way that satisfies and fulfills them.'),
(103, 'Intimacy', 2, 17, 'An intimate relationship is an interpersonal relationship that involves physical or emotional intimacy. Intimate relationships play a central role in the overall human experience. Humans have a general desire to belong and to love, which is usually satisfied within an intimate relationship.'),
(104, 'What single women really want', 2, 17, 'What do single women really want? We want you to love us even when we\'re not being very lovable. Do you want to know what else?'),
(105, 'Getting too close in a relationship', 2, 26, 'This is about the attraction that occurs between people who are initially getting to know one another. But the basic principle will help us understand about relationships that last longer.'),
(106, 'Too much distance between partners', 2, 26, 'Being physically close to your partner is central to romantic love. Indeed, temporal and geographical closeness typically increases emotional closeness, and this often makes distance seem intolerable. Some kind of distance, however, must remain, even between two lovers. What is the nature of such distance, and is it indeed intolerable?'),
(107, 'Friends with benefits', 2, 26, 'It’s about two close friends who think it would be fun to have sex with each other again and again. Until 1 falls in love and gets their heart broken when the other doesn&#39;t want a relationship.'),
(108, 'Casual to close', 2, 26, 'Casual relationship is a physical and emotional relationship between two people who may have casual sex or a near-sexual relationship without necessarily demanding or expecting the extra commitments of a more formal romantic relationship.'),
(109, 'Falling in love with a friend', 2, 26, 'Going out with a friend is something that needs a lot of thought. And if your friendship does mean a lot to you, think a while before making a move on a friend. Never forget that a relationship with a friend would never be the same if you ever split up someday.'),
(110, 'A taste for romance', 2, 26, 'No one knows when the fear of romance began to spread. It seems that everyone feels real terror at the thought of being called \'corny.\' Surely they do not know that romance is not necessarily corny and that what\'s corny is not necessarily romantic. Like everything else, it is a matter of balance.'),
(111, '10 ultrafast ways to land a job', 2, 27, 'It’s true -- the experience you have is an important part of landing a job. But a great way to set yourself apart from the others is to build solid relationships with prospects, employers and contacts.'),
(112, 'How to maintain relationships with your boss', 2, 27, 'Productive, respectful relationships between a boss and his or her employees is key to any company\'s success. While the boss\' top priority is likely to have hardworking employees who fulfill his vision for the company, it\'s a safe bet that he\'d also like to have more than superficial relationships with the people he works with every day.'),
(113, 'How to get a promotion', 2, 27, 'What can you do if you&#39;re interested in a promotion and it doesn&#39;t appear that you&#39;re going to be automatically offered a new position by your manager? There are ways to request a promotion diplomatically and to enhance your candidacy for promotion. Here&#39;s how.'),
(114, 'How to maintain relationships with colleagues', 2, 27, 'We&#39;re looking at how you can build strong, positive relationships at work. We&#39;ll see why it&#39;s important to have good working relationships, and we&#39;ll look at how to strengthen your relationships with people that you don&#39;t naturally get on with.'),
(115, 'How to get the best employee award', 2, 27, 'Employee recognition is not just a nice thing to do for people. Employee recognition is a communication tool that reinforces and rewards the most important outcomes that people create for your business.'),
(116, 'Dealing with divorce with a child', 2, 28, 'Every divorce will affect the kids involved — and many times the initial reaction is one of shock, sadness, frustration, anger, or worry. But kids also can come out of it better able to cope with stress, and many become more flexible, tolerant young adults.'),
(117, 'how to take care of your child as a single parent', 2, 28, 'If you&#39;re raising a child on your own, you&#39;re in good company. Single-parent families are more common than ever. Know how to manage some of the special challenges single parents experience and what you can do to raise a happy, healthy child.'),
(118, 'how to deal with your teenage kid', 2, 28, 'As your kids go into their teen years, many things will begin to change. To get along and help your teen develop in a positive direction, you&#39;ll need to change your expectations and develop empathy, all the while establishing boundaries. Creating a safe, supportive, structured, and loving environment is as important for you as it is for your teen.');
INSERT INTO `subsubtopic` (`id`, `title`, `mid`, `sid`, `desc`) VALUES
(119, 'becoming a step parent to a young kid', 2, 28, 'A stepparent can be an advocate for her stepchild, an extra adult who cares, and a critical resource for a child as she grows and matures.'),
(120, 'if your child is in a bad company', 2, 28, 'A parent&#39;s instincts about their child is right in most cases; and when you feel that your child may be getting into bad company, which may get in the way of his/her studies or pose a threat to his/her safety, then you must address the issue ASAP!'),
(121, 'Core Confidence', 3, 18, 'Success in all areas of life-career, relationships and finances, is dependent upon your personal sense of confidence. Contrary to what you may have been told, confidence is not something you are born with but instead it is a state of being that you can systematically develop. This program will teach you the recipe for growing and implementing lasting confidence as well as how to communicate that confidence in an empowering way that will lead you to success.'),
(122, 'Brain Power Energy', 3, 18, 'Brain power energy provides accurate, detailed readings to determine your strengths, needs, obstacles, and talents—and what your future may hold. Discover the power of numerology and reach your goals faster and with more ease. You\'ll gain invaluable insights into yourself and the world around you, and learn how to see ahead of the coming obstacles. Do away with your money troubles, your relationship issues, and your other woes with a stunning numerology reading.'),
(123, 'Leadership Expert', 3, 18, 'A leadership expert is a person who has extensive skill or knowledge in a particular field. Leadership provides new opportunities to others. It helps strengthen your current management skills with a powerful and a more distinguished dimension and is understood by most leaders that effective management is a prerequisite to being viewed as a great leader.'),
(124, 'Communication Expert', 3, 18, 'Communications or public relations specialists create and maintain positive relationships between their clients and the public often using media outlets. The first step to effective communication is generating an effective outcome by establishing positive associations.'),
(125, 'Breakthrough Expert', 3, 18, 'Breakthrough refers to a sudden, dramatic, and important discovery or development or an instance of achieving success in a particular sphere or activity. A breakthrough expert helps you move through or beyond an obstacle.'),
(126, 'Leadership &amp; Transformation Coach', 3, 18, 'Coaching for transformation is making a difference in the life of people while doing what you love. A Leadership &amp; Transformational coach helps overcome obstacles and create lasting change.'),
(127, 'Life Coach', 3, 18, 'A life coach helps people move forward and set personal and professional goals that will give them the life they really want. Most life coaching clients are healthy, successful  people who might be a bit stuck or simply want to make a big change in their lives and want the support of their own personal coach to do so.'),
(128, 'Steer Your Life', 3, 18, 'Life can be rather tricky. Things can be going smoothly for an extended period of time, and then, out of nowhere, you find yourself mired in a conundrum. But there is a way out. You are capable of straightening yourself out and steering yourself back on the right track – all it takes is a bit of focus. With this program, learn how you can navigate through life\'s many challenges.'),
(129, 'Manifestation Miracle', 3, 19, 'Are you ready to enjoy success, love and all the pleasures of life without any of the hard work? With Manifestation Miracle, you will hardly have to try hard at all as we use the Law of Attraction and a Universal Success Formula of Abundance to find happiness. Leave all of the effort, anxiety and hard work behind and start living the life you were destined for.'),
(130, 'Mind Reality Secrets', 3, 19, 'Do you believe in the power of the mind? You should, because with the secrets disclosed in \'Mind Reality Secrets,\' you can unlock the full potential of your psyche. This is an incredible journey toward lifelong fulfillment, wealth, and happiness. This one of a kind website will give you more than just a few more tools: you can find the ideal mate, perfect health, and more wealth than you\'ll know what to do with.'),
(131, 'Take Charge Expert', 3, 19, 'A Take Charge Expert helps you set direction and take action to get to the top of the ladder. Knowing that there is always more to learn, your expert backs you and helps you continually develop yourself.'),
(132, 'Life Transformation Coach', 3, 19, 'Transformational coaching involves helping people bettering themselves and their lives by bringing about necessary changes. Instead of changing how they act, however, transformational coaching clients work on changing the way they see themselves. Transformation Coaching is a highly effective and rapid means of releasing the hidden potential of people, and helping you reach your goals and objectives more quickly than you ever thought possible.'),
(133, 'Reinvent you', 3, 19, 'This program is a step-by-step guide to reinventing you. It gives an opportunity to wipe the slate clean in a new social context and adopt new behaviors that you were always capable of, but couldn&#39;t adopt in the previous social context because you were trapped in a given social identity. This program helps you basically rearrange your life.'),
(134, 'Breakthrough &amp; Growth Strategist', 3, 19, 'Even the best business plan for a breakthrough idea is guesswork. Companies that launch innovation initiatives tend to allocate most of their energy to generating ideas, even though common sense suggests that execution is equally important. And a Breakthrough and Growth strategist helps you in being selective about which growth strategy, or strategies, to employ, and to de-risk the processes within those strategies.'),
(135, 'Inner Power Expert', 3, 19, 'You may be more powerful than you realize. The spiritual aspect of inner power is a power which goes far beyond anything you can create yourself. Your inner power expert helps you achieve the goals of your life and have loving and lasting relationships, enjoy and prosper in careers, and radiate with life and healthiness. When this power is properly focused, you will achieve greater wealth, attract your ideal mate, heal yourself of chronic illness, heal a struggling relationship, and create a life of more enjoyment.'),
(136, 'Ultimate Body and Mind Transformation Strategy', 3, 19, 'This program enables you to change your complete approach &amp; mental strategy to incorporate physical fitness as part of your lifestyle effortlessly. But everybody needs a system to teach their mind and train their body in order to achieve that. With this program, learn a step-by-step strategy to know how both mind &amp; body are connected to each other and transform your physical fitness completely.'),
(137, 'The Code of Influence', 3, 20, 'Personal success has everything to do with how well you can influence those around you. Haven\'t you caught yourself wondering how happy people always seem to stumble upon good luck, wealth and new opportunities? The truth is that it has nothing to do with education, talent or business savvy but rather how well you can influence your peers as everything in life is deeply rooted to the human experience and relationships. Use The Code of Influence and prepare to completely redefine your life.'),
(138, 'Mind Secrets', 3, 20, 'Are you tired of settling for less than you deserve? Mind Secrets program will give you the ability to unlock the infinite potential of your subconscious mind which will allow you to reap the benefits of success attraction, wealth creation, everlasting happiness and mind healings. Stop pushing aside your true desires and dreams, as you will learn how to use the voice of your subconscious mind to transform every area of your life.'),
(139, 'The Millionaire Button', 3, 20, 'Are you tired of settling for less than you deserve? Mind Secrets program will give you the ability to unlock the infinite potential of your subconscious mind which will allow you to reap the benefits of success attraction, wealth creation, everlasting happiness and mind healings. Stop pushing aside your true desires and dreams, as you will learn how to use the voice of your subconscious mind to transform every area of your life.'),
(140, 'Success Coach', 3, 20, 'Success coaching is a process. As a process, it helps individuals both to define and achieve realistic financial goals faster and with greater ease than would otherwise be possible. This success coaching process is educational in nature and the result of this coaching is greater monetary success, greater personal wealth. It is about enhancing a person\'s ability to increase his or her personal wealth taking into account his or her available resources – including \'time.\''),
(141, 'ExtraOrdinary Life', 3, 20, 'If you want to live an exceptional and extraordinary life, you have to give up many of the things that are part of a normal one. People who prefer to live a \'normal\' life don\'t want to pay most of the costs of an extraordinary life. With this program, you can learn how to lead an extraordinary life while being ordinary.'),
(142, 'Efficiency Guide Book', 3, 21, 'Productivity is a tricky subject—everyone wants to be more productive, but very few people truly understand what to leverage in order to be more efficient. Think of our Efficiency Guide Book as a \'cheat sheet\' to becoming a more productive you. Learn the same strategies being used by people who are dominating their field such as David Allen, Stephen Covey and executives from Fortune 500 companies, all in our easy to digest and immediately actionable handbook. We don’t say this lightly, but our guide will change your life.'),
(143, 'Information Overload Course', 3, 21, 'This course is for professionals who get buried in daily e-mails, voice mails, junk mail, articles and reports. Participants discover ways to quickly sort between useful and useless information and manage multiple sources of information overload. Strategies include preparing a daily plan of action, reducing or eliminating desk clutter and giving important projects and tasks precedence.'),
(144, 'Analyzing Your Time Course', 3, 21, 'Participants in this course learn to identify where their time goes and how to manage it more efficiently through the use of a daily logbook. Students document and evaluate their use of time and discover how energy levels and personality affect time management outcomes. They also learn to match tasks with the time of day to take advantage of natural energy cycles.'),
(145, 'Planning and Prioritizing Course', 3, 21, 'Comprehensive analysis of a given workload by breaking it into manageable tasks and prioritizing those tasks into an effective to-do list is the central theme of this course. Emphasis is placed on the most effective sequencing of assignments and adherence to set timeframes to efficiently complete tasks and meet deadlines.'),
(146, 'Avoiding Time Stealers Course', 3, 21, 'This course examines procrastination, daily interruptions and taking on too many trivial tasks that steal time from the necessary duties that are critical to personal success. Students learn effective ways to handle phone interruptions, drop-by visitors and requests to take on additional work.'),
(147, 'Too Much to Do &amp; Too Little Time Course', 3, 21, 'This course helps students make the best use of their time by prioritizing their goals and workloads in the most efficient way. Students learn to identify tasks according to importance and urgency.'),
(148, 'Your Time, Your Priorities, Your Choice Course', 3, 21, 'This course will teach students about the necessary tools for effective time management. The course will also help students to learn about stress-management as it&#39;s directed toward health professionals and public municipal employees.'),
(149, 'E-learning for Educators Course', 3, 21, 'In this course, students will examine modern trends in online learning and the history of e-learning. Topics include theories in e-learning, web-based technology and course management.'),
(150, 'Happiness coach', 1, 30, 'A happiness coach brings your heart and mind together so you can discover true happiness of spirit. The saying that happiness is a choice is correct: so a purposeful approach is essential to building inner happiness. A happiness coach brings your heart and mind together so you can discover true happiness of spirit.'),
(151, 'Mind Shift Coach', 1, 30, 'A mind shift coach listens closely to fully understand the individual\'s or team\'s circumstances and acts as a sounding board in exploring possibilities and implementing thoughtful planning and decision making. A mind shift coach challenges blind spots to illuminate new possibilities and support the creation of alternative scenarios'),
(152, 'Performance Coach', 1, 30, 'Performance coaching is about helping all people reach their full potential, in any area of their lives. Performance coaching helps people explore their motivation, and overcome the blockers that hold them back. It is about both support and challenge.'),
(153, 'Fearless Dreams', 1, 30, 'Fearless Dreams is a program that simply aims at achieving the ability to think beyond reality and to wish for a better future. Through this program, we just dare you to dream big and then commit to making it happen and having it matter.'),
(154, 'Connect to Success', 1, 30, 'This is a program which aims to strengthen the business, by supporting its growth and development. The program focuses on developing the tangible business skills required to take the crucial steps towards achieving success.'),
(155, 'Heal your life', 1, 30, 'Since the mind and body are connected, illnesses of the body somehow have their root causes in emotional and spiritual aspects of the mind and its beliefs and thought processes. Through this program, You can learn how to control your emotions by having a control over your mind.'),
(156, 'Concentrate on what’s right', 1, 30, 'Why You Are Good, Worthy, Wonderful, Beautiful, and Unique You have dozens of wonderful qualities, traits great and small that make you capable, valuable, and worthy of love. Often it&#39;s easy to ignore these positive attributes and obsess on the things about yourself that aren&#39;t perfect. But when you do, you may risk harming your self-confidence and self-esteem. In this program, through guided reflection and journaling, you&#39;ll learn to find strength and self-reliance in your own best qualities. You&#39;ll  get to know yourself better, and you&#39;ll love all the wonderful things you&#39;ll discover in the process.'),
(157, 'Think big', 1, 30, 'The main motto of this course is to see what can be and not just what is present. This course enables you to visualize things that you can achieve, visualization adds value to everything and thinking big means training oneself to see not just what is, but what can be. The course forces you to visualize and then announce what you plan to achieve as that makes you and the person you are talking to feel better.'),
(158, 'Your true potential', 1, 30, 'Are you a person who had big dreams, but got lost somewhere in the middle? \'Your personal potential\' course helps you reconnect with your dreams and jumpstart your personal transformation. If you feel stuck, unmotivated, and uninspired; this course if where you explore your potentials and start your journey to your dream life.'),
(159, 'Living a blissful life', 1, 31, 'Living a Blissful Life is a Journey. You have to want to be that person who marches directly towards a magnified emotional state of joy, fulfilment and happiness rather than one that rests by the roadside. Bliss is a magnified emotional state of joy, personal fulfilment and happiness. And through this 2 Day program you will learn the strategies on how to lead a blissful life.'),
(160, 'Improve your self-confidence', 1, 31, 'To build self-confidence means to replace negative thoughts with positive thoughts like &quot;I can do this&quot; and &quot;I&#39;m beautiful the way I am.&quot; This program helps you to focus on the things you&#39;re talented at, and realize that you don&#39;t have to be good at everything. Through this program you will learn how to avoid comparing yourself to others and focus on being the best version of yourself instead.'),
(161, 'How you overcome stress', 1, 31, '\'How to overcome stress\' is a program that has Hundreds of natural remedies can help you curb stress when it&#39;s at its peak. This makes sure you do something that you enjoy. This course provides you with exercises and assignments that make sure you curb your stress. With this program you can learn to manage your stress levels in your everyday life. Learning how to reduce stress and its associated patterns can make you a more active participant in your happier life.'),
(162, 'Path to happiness', 1, 31, 'We all want to be happy, but do we know how? When it comes to improving tomorrow at the expense of today, we&#39;re terrible at predicting how to please our future selves. Path to success combines psychology, neuroscience, economics and philosophy with irrepressible wit to describe how the human brain imagines its future - and how well (or badly) it predicts what it will enjoy. This program reveals some of the amazing secrets of human motivation.'),
(163, 'Emotionally Powerful', 1, 32, 'Do you feel that you\'re caught up in the past and that is holding you back from LIVING LIFE TO THE FULLEST? \'Emotionally Powerful helps you recognize how the past has held you back so that you can begin the process of reclaiming your life. Through this course, you will be able to make a robust decision to take on the complete responsibility of your life, so that you can live it on your own terms.'),
(164, 'Inner calling', 1, 32, 'Inner calling is a proven system which will help you access your Inner Compass to gain control over your life. It enables you with tools of the law of attraction which are necessary to become a Master Navigator of your Life.'),
(165, 'Transform your thoughts', 1, 32, 'It may sound too simple that changing your thoughts could affect your entire life, but it is a scriptural truth threaded throughout the Bible and proven over thousands of years. Learn scriptural strategies that will get you out of the comfort zone of mediocrity, to think constructively and optimistically about yourself and your future, how you can move into the seemingly impossible, and develop the courage to achieve great things for God!'),
(166, 'Develop your habits', 1, 32, 'How long does it take to develop a new habit? The time period can be any length from a single second to several years. The speed of new habit pattern development is largely determined by the intensity of the emotion that accompanies the decision to begin acting in a particular way. \'DEVELOP YOUR HABITS\' is a seven step system that helps you think more effectively, make better decisions and develop a new habit pattern.'),
(167, 'Gateway to peace', 1, 32, 'Sometimes when fear has created something that is making it hard to find peace and happiness, logic can move the fear based ideas. \'Gateway to peace\' is a course that helps you turn your fears into little bite size pieces and toss them aside.  It enables you to hear yourself and find new ways and new audiences for your ideas.'),
(168, 'Superior You', 1, 32, 'Superior You is a smart, how-to suggest guide for men and women looking for motivation and information to overcome their personal struggles of overall wellness. We all have a blueprint that we follow and act in a particular manner, but there is more to it and through \'super you\' you can learn a step by step system that helps you find your inner strength using the law of attraction.'),
(169, 'The formula of getting rich', 1, 32, 'The formula of getting rich is more than any other money making course. It gives you a distilled wisdom that guides you towards both acquiring wealth and living a more fulfilled life. There are certain laws which govern the process of acquiring riches; and trough this course, once you learn these laws and get rich with a mathematical certainty.'),
(170, 'Astrology', 4, 3, 'Through education, resources and reports we are able to help you gain a better knowledge of yourself. With personalized and secure charts, you will find insightful, informative and downright entertaining information regarding you and your life. Whether you are seeking insight on your relationship, career changes, relocation or any other area of your life, we can provide you with a report that will shed light on all of these topics.'),
(171, 'Numerology University Certification Program', 4, 4, 'In Numerology, you develop basic skills to enhance your journey to success and to better understand the biggest challenges that you experience throughout life. This Numerology Certification course will help you to cultivate the techniques necessary to find your life partner, ignite your passion, find your life purpose and nurture your soul for a happier life.'),
(172, 'Ultimate Online Tarot Reading Course', 4, 5, 'With 78 cards in every Tarot deck, the overwhelming amount of images and meanings to memorize is often what causes people to give up on their dream of reading Tarot cards altogether. There are plenty of books, live training courses and self- instruction that you could attempt to learn from, but they all actually require you to sit down and correctly remember the convoluted and intricate meaning of the entire deck. With our multimedia training course, you will be able to learn through watching, listening, reading and actually doing. We have put an electrifying new twist on Tarot card reading that will make you one of the most dynamic Tarot card readers imaginable.'),
(173, 'Through the Eyes of a Traveler ebook', 4, 6, 'With this program you can unlock the power that will allow you to travel through time and space at will, communicate directly with others and access knowledge through the power to control matter with your mind. Over 20 years of investigation and remarkable discoveries have led to the development of this program which provides step-by-step instruction for mind travel. With this program, you will discover a whole new world of knowledge and reality.'),
(174, 'Ghost Hunting Book', 4, 6, 'If your recent Google searches look something like \'ghost hunting tips\', \'how to be a ghost hunter\' and \'ghost hunting for beginners\' then rest assured that you have come to the right place. This handy guide will help you get started conducting successful paranormal investigations with the right equipment, expert knowledge and insider tips. Whether you are a novice or  an expert, this concise program will open your eyes to a new way of thinking and approaching ghost hunting.'),
(175, 'The Paranormal Log and Analysis Notebook', 4, 6, 'Whether you are an individual ghost hunter or part of a larger team of paranormal investigators, you are probably well aware that the hardest part of any investigation is keeping track of background information, interviews and data. With this paranormal software, you will be able to easily track investigator\'s profiles, statistics, equipment inventory, types of activity and EVPs recordings. This easy to use software plan will ensure that an investigation is never compromised due to clerical errors so you can focus your time and energy on what you really love—ghost hunting!'),
(176, 'The power of Psychic Seduction Crash Course', 4, 7, 'The power of Psychic Seduction is very real and extremely influential to those looking to change the course of their love life. Whether you blew your chances with the girl of your dreams or you need to regain your girlfriend\'s love and affection, this guide will show you how you can use telepathic techniques to get any girl you want. It doesn\'t matter how average or unattractive you are, this product will ensure that you are never lonely again.'),
(177, 'Master of Miracle', 4, 7, 'With the help of this program, you have the potential to unlock the true mysteries of the human potential. Miracle Mystery will lead to such tangible results like the power of telekinesis and the ability to heal that other psychic perceptions will simply seem like a side-effect. Empower yourself today and start unlocking the abilities of condensation, projection and manipulation which will lead to life changing experiences.'),
(178, 'Developing Supernatural Powers', 4, 7, 'It is a fact that every human on this earth has been endowed with abilities of psychic powers, clairvoyance, telepathy and mental influencing. Yet the majority of people remain unaware that they possess these \'supernatural powers\', let alone how to harness their power. With this program, you will learn how to develop your metaphysical and psychic abilities in a way that will allow to you better communicate with your higher-self and understand your intuitive energy.'),
(179, 'Sculptor 7', 4, 33, 'If you can just spare 10 minutes every day, you will learn the skills necessary to begin living the life of your dreams. With a technique deeply rooted in science and the power of your computer, you will be able to make more money, maintain a loving relationship, score your ideal job and improve your health. Follow the simple step-by- step guide and begin unleashing the wealth and success you’ve always desired'),
(180, 'Third Eye', 4, 33, 'With the ancient science of the Alchemy of the Third Eye, you will be able to free yourself from being trapped in the cycle of life and death. Purify your mind, body and spirit as you learn how to fully activate your third eye in a way that will increase your intuition and awaken your spirituality. This guide will allow you to turn your vision inward and ultimately attain wholeness of your true self.'),
(181, 'Supercharge Your Sermons', 4, 34, 'As a preacher, you have likely had a difficult time constructing powerful and moving sermons week after week. With this product, you will learn innovative and honest tips that your audience will immediately connect with on a spiritual level. Rather than appealing to the intellect, you will begin writing sermons in a way that will awaken, enlighten and give hope to your congregation.'),
(182, 'Media Vault', 4, 34, 'Finding your purpose in life is something that most people struggle with on a daily basis. You might feel lost and disconnected from your career, family life, yourself and even God. But you are not alone. With this monthly package you will discover how easy it is to forge a new path in life towards personal, professional and spiritual growth.'),
(183, 'Past Life Regression', 4, 35, 'With this product you can bring the ultimate past life regression experience into your own home and uncover your past while you sleep. As you are lead into a relaxed state of consciousness with two beautifully produced audio recordings, you will have the chance to explore your lifetime over and over again in order to gain more information. Get ready to discover more of who you really are.'),
(184, 'Timeless Youth Blueprint', 4, 35, 'It doesn\'t matter how old you are or what your personal circumstances are, you still have time to turn back the clock of your body. Deep inside every human being, there is a switch that will allow you to have almost anything your heart desires while maintaining absolute physical, spiritual, emotional and energetic greatness. With this program, you will learn how to turn that switch on and begin living the life you were meant to.'),
(185, 'Noonebu Academy', 4, 35, 'The science of Noonebu Philosophy was designed to bring about universal reasoning, balanced living and respect to the laws of nature. With this program you will be invited to join a community of philosophers that aim to attain higher levels of knowledge and a better understanding of our individual and collective natural being. You will have access to literature, audio files, videos and webinars that will guide you along your journey as a Noonebu Philosopher.'),
(186, 'The bible of Health', 4, 35, 'With this one of kind eBook, we will bridge the gap between the Word of God and modern day science. The bible contains a wealth of knowledge regarding health, diet and how to avoid cancer, diabetes and other diseases. It doesn\'t matter what denomination you practice, this eBook will give you the instructions on how to cook and eat in the way that God intended. With this guide, you will be able to live a long and healthy life for as long as we are in these flesh bodies.'),
(187, 'Chakra', 4, 35, 'Awakening Kundalini allows the qualities of the Chakra to begin expressing themselves spontaneously within your life. This leads to a more dynamic, creative and confident mindset. With these unique musical compositions, all you need to do is listen as binaural and isochornic beats produce brainwave entertainment. With just 70 minutes of music, the harmonies will attune and energize your chakras in a natural way.'),
(188, 'Believe System', 4, 35, 'You\'ve likely tried time and time again to use \'The Secret\' and numerous Law of Attraction techniques in order to turn your life around. You\'ve visualized, recited affirmations and ordered the universe more times than you can count, and yet you haven\'t experienced any change. What are you missing? Simply put, you are missing the key component of change. With this guide, we will show you how to integrate genuine belief into your manifestation process in order to start living a happier life.'),
(189, 'Subconscious whisper', 4, 35, 'Discover the ultimate mind hack to live a fuller, more enlightened life. With this program you will finally be able to discover the hidden path that unleashes your natural energies and talents. There are eight spiritual \'hacks\' you will learn to integrate into your everyday life that will help you overcome challenges, maximize your potential and experience higher levels of happiness and satisfaction.'),
(190, 'Unleash Your Mental Power', 4, 35, 'If you are allowing yourself to live the way your subconscious mind wants you to live, you are likely filled with anxiety and conflict on a daily basis. Even your conscious mind is armored to protect your subconscious to enforce your beliefs, habits and behaviors. Living like this can be widely destructive as you will be limited in what you can accomplish. The solution lies within your personal will, with this program you will learn how to use your will to soar above both the conscious and subconscious of your mind in order to take complete charge of your life.'),
(191, 'Default Mode', 4, 35, 'It is time you stop living in default mode and start living in design mode. In order to achieve happiness and prosperity in your life, you must start creating your life consciously in order to fight against the default mode of decay. With this program, you will be able to manifest your thoughts and actions in a way that creates ideal and deliberate alignment with life’s ultimate treasures.'),
(192, 'Decoding the DNA System', 4, 35, 'Since birth, you have been carrying around with you the knowledge and code that has the ability to unlock your true calling in life. This puzzle is encoded in your DNA and has the ability to decipher your special talents, what career path you should take and even who you should marry. But in order to reveal your true identity, you must learn how to correctly use the  Julian calendar (that\'s the same calendar you have hanging in your kitchen). This program will reveal your true nature and help you to start feeling immediate changes.'),
(193, 'Life Secrets', 4, 35, 'Be prepared for your entire life to change. In just 30 short days from now, you will have the power to accomplish absolutely anything you set your mind to. As a compelling master of persuasion, you will have unbelievable charisma, inconceivable wealth, a passionate sex life and perpetual influence in all areas of life. Stop dreaming and start living the reality you have always desired.'),
(194, 'The Gratitude Workbook', 4, 35, 'Gratitude has the power to make you feel happier, love yourself and put you on the right track to accomplishing all of your dreams. When gratitude is practiced and demonstrated on a regular basis it can bring upon a spiritual awakening that can be life changing. This workbook will provide you with a road map, quotes and regular self-assessments to guide you along your journey to gratitude.'),
(195, 'Miracle Brain Method', 4, 35, 'No matter what you desire in life—making more money, meeting the person of your dreams, improving your health, etc., our Miracle Mind Method will allow you to empower yourself and begin living the life you have always wished for. With this powerful method, you will no longer worry about the future and what to do with your life, as you will start experiencing success in all areas of life.'),
(196, 'The ultimate Manifestor', 4, 35, 'Most people don’t realizes how many forces outside of their control are preventing them from living their dreams, and even those that do see the obstacles are unsure how to break free from the shackles. If you are one of the many people struggling to manifest, our sacred method of music and meditation is exactly what you need. With our system you will be able to release any abundance. Energy blocks currently residing within you so that you may finally begin to live a life of wealth and abundance.'),
(197, 'The Awakening Course', 4, 35, 'This Awakening Course is your manual for spiritual wholeness and balance! This downloadable program is unlike anything available on the web, with all the information you need to lead a balanced life full of wealth and happiness. Discover true happiness with the four revealed stages to ideal health, wealth, romance, and more. Transcend your problems and find true meaning with the Awakening Course.'),
(198, 'Secrets of Hypnosis', 4, 36, 'In order to master Hypnosis, you must first understand that critical knowledge of WHY hypnosis works. Once you understand why it works, you will then know exactly the best approach to any situation. You will no longer risk using subpar techniques that end in a disaster, as  this program will show you how to confidently use your knowledge of hypnosis whenever and wherever you desire.'),
(199, 'Mind Force System', 4, 36, 'Using the Mind Force System will help you to maximize your life and become a happier and more powerful you. These 12 guides will teach you the incredibly effective \'Distilled Learning Method\' which will lead to personal breakthroughs, more confidence, increased energy and the ability to manifest the life you desire.'),
(200, 'Stage Hypnosis', 4, 36, 'Contrary to popular belief, stage hypnosis is something that can be learned and used by anyone. Much like driving a car or riding a bike, stage hypnosis is extremely easy to learn. The essential part is knowing what to say, how to say it, what to do and how to do it. This product will give you the knowledge of why and how this technique works, and you will quickly become a master of stage hypnosis.'),
(201, 'Hypnosis to Change Your Life', 4, 36, 'If you are ready to make big life changes but you don\'t have the willpower to do it on your own, this product is exactly what you need. Whether you want to quit smoking, lose weight or have the confidence to go after your dream job, this product will guide you along the way. Hypnosis will draw out your innate strengths and capabilities to help you live a happier, better life.'),
(202, 'Black Ops Hypnosis', 4, 36, 'This mind control program is so powerful that before you can get your hands on it, you must swear to never reveal these techniques to anyone else. With our controversial and effect hypnosis methods, you will quickly become a master of persuasion with the ability to put anyone around you in a trance. This empowering knowledge give you all the skills necessary to make anyone think, forget or remember whatever you want them to.'),
(203, '151 Ways to Hypnotize Anyone', 4, 36, 'This exclusive and secret manuscript has over one hundred unique hypnosis strategies for you to use and enjoy in whatever way you wish. Perhaps you are looking to improve your quality of life by persuading others, or maybe you just want to erase bad memories so that you can focus on your present and future successes. Either way, this product will teach you the science and the art of hypnosis so you can begin changing your life today.'),
(204, 'The Reality of Hypnosis', 4, 36, 'In just 1 hour per week, you can learn how to use hypnosis in order to take control of your behaviors and influence others. You will experience permanent change that can lead to weight loss, stress reduction and giving up bad habits. This program will also teach you everything you need in order to give indirect hypnosis commands and in turn covertly influence people around you in powerful way.'),
(205, 'Clinical Hypnotherapy Course', 4, 36, 'The Clinical Hypnotherapy Training Course will take you from complete novice to an expert in the field of clinical hypnotherapy. Whether you are looking to take advantage of a life changing opportunity, or you are simply working towards self-improvement, upon  completion of this course you will have more than enough knowledge to start your own practice. Begin the course today and start improving the quality of your life.'),
(206, 'The Reiki Therapists Handbook', 4, 36, 'If you are currently on the path to becoming a Reiki therapist, you are likely spending most of your time going through your attunements and practicing on all your friends and family. While these are all necessary steps to becoming a professional therapists, it\'s equally important that you are prepared to meet with clients in the real world. With this handbook, we will walk you through the steps necessary to setting up a professional and comfortable space that will leave your clients feeling comfortable and secure.'),
(207, 'Reiki Meditation Package', 4, 36, 'With our program you will discover that it is possible to meditate and improve your overall Reiki in just 30 minutes a day. This cutting edge, brainwave entrainment techniques of Binaural Beats and Isochronic Tones will take you to a profound level of meditation, self-healing and embracing your intuitive abilities. Prepare to reduce stress, awaken psychic abilities and wipe out all negative behavior.'),
(208, 'Past Life Regression Certificate', 4, 36, 'The techniques used in our courses were once considered improbably within the medical industry and are now a cornerstone of therapeutic practice. Be prepared for powerful and life altering experiences, new levels of self-understanding and a lasting foundation of change. With Basic Past Life Regression Hypnosis, you and your clients can embrace and move past previous life experiences in order to elicit positive changes.'),
(209, 'Six-Week Hypnotist Certification', 4, 36, 'Whether you are a layman without any hypnosis background or you are simply looking to go to the next level of hypnosis, this powerful course is right for you. With advanced master applications of NLP, you will be able to unlock new tools for success, happiness and achievement. After completely your online course, rest assured you will be able to perform self-hypnosis as well as treatments on your friends and family that can help break negative cycles and build unlimited confidence.'),
(210, 'Super Affiliate Tracking', 5, 1, 'Want to learn how to become a real successful affiliate marketer? This isn\'t a get-rich- quick scheme and it takes real work. The super Affiliate Handbook is designed to teach you how to become a successful affiliate marketer using our step-by-step plan to business building. We\'ll teach you how to build your website, how to assess a market, which products to avoid, how to negotiate your commissions, and much more. The book is over 200 pages long, and is jam-packed with important information describing everything you need to know to make it as an affiliate marketing professional.'),
(211, 'Health Business in a Box', 5, 1, 'Do you want a website that instantly provides you with 90 incomes streams for next to nothing? This program will give you a fully operational website that sells the best health products on the market today! The site is designed to produce viral traffic automatically, with little to no effort required. It also has a built in spokes model, our powerful tell-a-friend viral tool, and an automatic sales manager that\'ll automatically connect your visitors to you, your links, and your affiliate IDs.'),
(212, 'Cell phone Monopoly', 5, 1, 'Who says you need your own website to earn money online? The \'Cell phone Monopoly\' software will help you earn thousands of dollars a week without a website, paying for traffic or your own products. How? Through the amazing power of mobile webinars that you can set up without lists, presentations, even without making a personal appearance. You can activate these mobile webinars from practically anywhere and watch them bring in the big bucks! \'Cell phone Monopoly\' contains three complete, pre-recorded mobile webinar presentations that can get you commissions today, as well as three squeeze pages optimized for mobile platforms that\'ll drive lucrative mobile traffic directly to your automated presentations! You\'ll even get lifetime updates to the core software and access to a quick start training course! If you want to earn huge sums of money online quickly, easily, and on-the-go, \'Cell phone Monopoly\' is the right tool for you.'),
(213, 'WordPress Theme', 5, 37, 'Do you need a WordPress theme that really gets you? This is created by marketers, for marketers. It\'s been used on over 150,000 websites so far and features built in ad locations, custom header designs, and an incredible support forum to ensure that you can make the most of your theme.'),
(214, 'A-List Blogging', 5, 37, 'With the right help, ANYONE can learn to run a popular blog. Have you been thinking about starting your own blog, but just haven\'t had the time, motivation, or courage to pull the trigger and go for it? Worries about not finding an audience, the possibility of hitting a technological barrier, or just not having the time can be intimidating obstacles standing in the way of your success. Don\'t worry, we\'ve all been there, and it\'s totally Ok to have doubts. A few years down the road I can tell you that you really CAN make money blogging. My A-List blogging Masterclass has taught over 4000 bloggers how to grow a successful blog on the internet. Sign up today and learn the insider secrets to easily create a thriving blog.'),
(215, 'ID PLR', 5, 38, 'If you\'re looking for that one comprehensive package of PLR products, you\'ve just found it. The IDPLR business-in-a-box package has all the content you\'ve ever thought you\'d need, and then some! Membership includes over 4600 eBooks, over 870 videos, more than 210 graphics packs, literally tens of thousands of PLR articles, and so much more! Over 30,000 individual products, with more added daily, can be yours if you sign up. You\'ll also get access to priority support and 5 GB of hosting space compatible with all the popular Internet marketing tools. What are you waiting for? Give your business a second life or start a brand new one today! With the IDPLR membership, the sky\'s the limit when it comes to profiting online.'),
(216, 'Gain Higher Ground', 5, 38, 'That all-in-one system for creating a sustainable, successful and profitable online business is finally here! Join us and start making money online right now! If you become a member of this fantastic website, you\'ll learn how to build online businesses from the ground up, exploit goldmine niches, direct real, lucrative traffic to your business, create and market your content and products, and so much more. Membership to this website even comes complete with updates and full support, as well as unlimited free hosting! Even if you’re a complete beginner, with no technical knowledge or skills, you can create your very own online business!'),
(217, 'Simple Traffic Solutions', 5, 38, 'Aren\'t you tired about missing out on precious webpage traffic? Is spending money on traffic programs just not an option for you, or have you tried them and seen them fail? \'Simple Traffic Solutions\' is the only program you\'ll ever need to drive profitable traffic your way, without spending a thing! This is no ordinary guide, but a content-rich package, including 20 multi-format training modules that you can view on multiple devices, a comprehensive PDF report, an easy-to-follow mind map, and a step-by-step worksheet to help you get organized. Turn your web pages into the hot spots of the Internet in no time at all! You\'ll learn so much from this detailed training course that you\'ll never have to worry about traffic again.'),
(218, '5 Figure Day Unleashed', 5, 38, 'Looking for that one lucrative way to earn money online? Join us and watch as the dollars come rolling in! The membership to this website will let you a live and ready-to- go that you can use to get new members to join. We\'ll help you promote products that are automatically tagged with your affiliate links – and every time they buy something, you\'ll automatically earn the commission fee! This system can work practically on autopilot, building you lists of potential commissions on its own! This system can get you unlimited, automated income and commission potential, as well as unlimited leads and list building, and best of all, it\'s fully tested and beginner-friendly, so you can start using it today even without any prior knowledge!'),
(219, 'Free Monthly Websites', 5, 38, 'Wouldn\'t it be great if you could own a moneymaking website? But aren\'t you worried about all the hassle and stress involved in learning how to build one? Leave those worries at the door – We will provide you with a website of your own that\'ll soon start bringing in the big bucks. Not only that, you\'ll get a new, completely free website each month, chock-full of content, that\'ll generate traffic practically on its own! Don\'t skip out on a chance to upgrade to premier membership that\'ll get you even more content, more themes, search engine optimization, and the ability to add your own ads, as well as additional training and special premier member support! With this, you\'ll be on your way to quick and easy money in no time at all.'),
(220, 'Get Paid Taking Pictures', 5, 38, 'Did you know you can earn top dollars each week simply by uploading pictures? This system will teach you how to do just that, by exploiting the websites that’ll pay you for ordinary, everyday photos. Your pictures of ordinary people doing everyday activities will keep bringing you money all on their own, day in and day out. This exclusive package includes a detailed guide with all the insider secrets on how to earn money from everyday photos, access to the personal upload directory with constantly updated lists of websites where you can submit your photos, and so much more! Just think of all the free time you\'ll have – and you\'ll need it to spend the enormous amounts of cash you\'ll get using this goldmine of a system! Turn your smartphone or camera into a moneymaking machine with these exclusive trade secrets.'),
(221, 'Ad Trackz Gold', 5, 39, 'Do you want to know how you can optimize your ads to make the most of your money? This can save you massive amounts of money while increasing ad responses and sales exponentially! It allows you to track which keywords result in a sale, where your traffic is coming from, and helps you protect your affiliate links, shorten your tracking URLs, and split your sales letter. These and many other features allow you to take total control of your internet marketing project to help ensure your success.'),
(222, 'Get Illustration Clients', 5, 39, 'Are you an illustrator that loves working, but hates marketing? You\'re in luck! I\'ll show you how to triple your illustration clients in a week, even if you can\'t stand marketing. My ebook is your solution on how to consistently get great paying clients. We\'re not interested in being salesy and manipulative, we\'re just here to show you how to get the job done simply and effectively. Best of all, this guide is tailored specifically to the needs of illustrators, so you don\'t have to worry that our methods won\'t work for you. Check it out today!'),
(223, 'Make them Buy Two', 5, 39, 'Are you tired of struggling to make a profit from your website? What would it be worth to double, or even triple your income on your existing traffic? This system can help you succeed! Join our club and you\'ll get access to exclusive monthly webinars, access to previous recordings, specific feedback for your questions. Additionally you\'ll receive our BONUS materials that are designed to bump your sales FAST, and maximize your sales in the long term by building your persuasion architecture.'),
(224, 'Facebook Traffic Rush', 5, 39, 'Want to learn how you can use Facebook to make money? I\'ve been making over 100 dollars a day promoting just ONE affiliate product on Facebook for the last 9 months! With Facebook Traffic Rush you\'ll learn how to effectively market a single product via Facebook. Our unique training course will show you how create a great Facebook page, how to create a great ad, how to define your audience, how to bid for adwords, how to scale up and everything else you need to know to make your affiliate project a success. Try it today!');
INSERT INTO `subsubtopic` (`id`, `title`, `mid`, `sid`, `desc`) VALUES
(225, 'Money GrowthFly', 5, 39, 'Always on the lookout for that winning business formula? Tired of training courses and programs that offer a lot, but never deliver? Why spend your money on a single system when you can buy an all-access pass to Money GrowthFly and get over 30 incredible, detailed courses and guides for making money online? Learn all there is to know about online businesses from building your own website to getting profitable traffic to come your way, all from this revolutionary package deal that features no levels of membership, no premium groups, and no  restricted access of any kind. With a Money GrowthFly membership, you\'ll never have to look for a new online business strategy ever again.'),
(226, 'Online Book Club', 5, 39, 'Did you know you can make money off of Kindle books even if you\'re not an author? It\'s true! You can learn all about it if you join the \'Online Book Club\' training course! The market for Kindle books is taking off in a big way, and this fantastic course, consisting of 20 training videos, will teach you all you need to know to outsource and market best- selling eBooks and reap in the profits in no time at all. What makes this course unique are the frequent updates, meaning you\'ll get new templates, resources, videos and techniques all the time. Add in the forecasting videos that\'ll tell you all about sales patterns and upcoming trends, and access to a networking group of other Kindle authors that\'ll help you promote your eBooks, and you\'ve got a truly outstanding training package that\'ll get you the results and cash you\'ve always wanted.'),
(227, 'Stealth Mode', 5, 39, 'Strategy is key to any business, and it\'s no different when you\'re doing business online. That\'s why any professional in the making needs to know how to successfully market their business. For all the key tools, tips, and techniques, look no further than Stealth Mode, a fantastic service that will deliver proven, effective moneymaking and marketing strategies every single month. Get the results you\'re looking for, the customers you need, and the profitable traffic your business deserves, all with the affordable Stealth Mode membership! To make the offer even sweeter, you\'ll also get three bonus software programs to increase your earnings and a pack of high quality graphics that are royalty- free. The boost for your business you’ve been waiting for is just a few clicks away.'),
(228, 'Niche Video Coaching Course', 5, 40, 'Looking for an undiscovered lucrative niche market to target with your affiliate marketing efforts? The Niche coaching course is the perfect solution to your problem! You\'ll get access to 12 incredible training videos, informative step-by-step PDF lessons, and homework assignments that\'ll take you through the process to find a lucrative niche that you\'re passionate about. Best of all, you\'ll get access to our Niche Sherpa members community that\'ll help you consult and network with like-minded people!'),
(229, 'Ultimate wordpress Theme', 5, 40, 'If you\'re an Amazon affiliate, then you need to check out the Ultimate wordpress Theme; the wordpress theme that integrates your affiliate experience seamlessly. With the streamlined graphics, your small business will benefit from the legitimacy of promoting your affiliation with Amazon and your customers will feel secure. You’ll also get built-in SEO options, link tracking, and so much more. The Ultimate wordpress theme is also 100% easily customizable so you can give your site a unique flair and integrate your branding material. If you want to take your online business to the next level, invest in the Ultimate Amazon Theme today.'),
(230, 'Get Cash for Surveys', 5, 41, 'Did you know you can make big bucks online by doing quick surveys for companies in the comfort of your own home? It\'s true – you just need to know how to get started! Fortunately for you, we are here to give you a helping hand. You can earn easy money just by  helping big companies and corporations do market research! You\'ll learn all about places that offer hundreds of surveys that you can do right now – and, as an extra treat, you\'ll also find out how you can get paid for reviewing new products that you can later keep! Filling out surveys can net you hundreds of dollars every week, so join now!'),
(231, 'EBook Club', 5, 42, 'You don\'t have to be a college graduate or super genius to understand the simple economics of an online business. All you need is a simple idea. The \'EBook Club\' can help you join the ranks of top infopreneurs. Instantly profit 100% from 50+ new products created for you every single month! Quickly and easily set up profit pulling websites that get you money, no experience required. Owning your own Info Product or line of Info Products is one of the best choices you can ever make in your Information Marketing career. Join the \'EBook Club\' today and get started!'),
(232, 'Pitch Magic', 5, 42, 'Without a landing page, you don\'t stand a chance as a ClickBank vendor or affiliate. Learn how to make one today with Pitch Magic, and see huge profits come your way in the blink of an eye! There\'s no need to learn complicated HTML coding, PHP databases or graphic design – Pitch Magic is all about simplicity and saving you time and money! It comes with over 300 pro designs for landing pages that\'ll attract visitors and clients to your online business. With its automatic formatting capabilities, easy customization, and a host of other features, Pitch Magic is the only service you\'ll need to create the perfect landing page that’ll make you stand out in a sea of competitors.'),
(233, 'Link Building Course', 5, 43, 'Whether you\'re a beginning link builder or an expert, there\'s something in this course that you desperately need. If you\'ve been looking to other labor—outsourced personnel, interns, or in-house marketers— you already know that very few have the kind of knowledge that’s needed. With \'Link Building Course\', you can just hand them off modules, like the Beginner\'s Guide and Conducting A Campaign, without wasting time teaching them the fundamentals. Available as a PDF so you can easily share it with others, \'Link Building Course\' can make scaling your link building efforts easier than ever.'),
(234, 'Power Portal Pro', 5, 43, 'Are you looking for the most powerful internet marketing tool on the market today? Power Portal Pro is the ultimate keyword and market research program you can lay your hands on. We use 6 major search engines to help you identify missed business opportunities, find untapped market niches, and discover exactly what people are trying to find on the internet in any specific market niche. If you work in SEO or PPC, or you just want to make the most out of your internal marketing efforts, then this program is the essential tool you\'ve been looking for.'),
(235, 'Bring the Fresh', 5, 43, 'Are you serious about making real money on the internet? I can help you, if you\'re willing to help yourself. The BTF system will teach you how to get serious about affiliate marketing and to become truly successful. Your money will get you all of our training videos, and access to our massive 20,000 person-strong community of affiliate marketers who can help you on your way to becoming a successful internet entrepreneur.'),
(236, 'SEO Nuclear', 5, 43, 'Want to start up an online business, but don\'t know where to begin? Tired of expensive coaching courses that end up teaching you nothing? You too can make thousands of dollars in commissions each and every month by following proven marketing techniques and methods. SEO Nuclear will show you the do\'s and don\'ts of online business and teach you how to pick the right strategy to drive sales, subscribers, and lucrative traffic your way. Don\'t waste your time on pricey schemes and systems that don\'t work, we have all the real, tried and tested info you need to make money online.'),
(237, 'Social Manager', 5, 43, 'You can\'t optimize your website for search engines without regular, consistent backlinks. As any SEO specialist or manager knows, it can be difficult to build a stable backlinks base – so why not take a shortcut? Build a network of backlinks in no time at all, and even give your existing ones a boost!'),
(238, 'SEO Expert', 5, 43, 'Are you an SEO specialist looking for ways to improve your content marketing? Do you want to increase your website’s rankings and drive profitable traffic to it quickly and easily? Would you believe there’s a plugin that\'ll let you do all that, and so much more. With a dedicated keyword optimization engine, an automatic smart linking tool, and image optimization and rich snippets capabilities, your website will rise in the rankings in no time at all.'),
(239, 'Keyword Pro', 5, 43, 'The #1 keyword research tool for affiliates, marketers and SEO pros, hands down. Our software was built by internet marketers for internet marketers. You see, we faced the same struggles you do… to find profitable keywords, in the right niche, period. With our proprietary Keyword Competitiveness Score you will find low competition keywords with little effort. Helping you rank quickly and saving you valuable time &amp; money, right from the start.'),
(240, 'Traffic Wizard', 5, 43, 'Want to move your business to the very top of the most popular search engines? Better rankings, more traffic, more customers, greater profits – this can all be yours with our help! If you need to improve the online visibility of your business, regardless of what you are using to market it. It can create hundreds of accounts, verify them, spin your submissions into original content and submit it to more than 2000 websites, all on its own! With updates, access to interactive forums, a trusty customer support desk, and so much more.'),
(241, 'Guaranteed Solo Ads', 5, 44, 'Are you tired of hitting dead lists that click but never buy? These lists pack the spending firepower you’ve been looking for. ListBuilding just got easier, faster and more affordable, guaranteed! With our guidance you\'ll get guaranteed unique clicks, guaranteed optins /subscribers, 100% Tier 1 email and traffic that starts on the same day as purchased.'),
(242, 'Tweet Dis', 5, 44, 'Would you like to learn how you can generate huge amounts of traffic from Twitter? We make it easy for you to build your presence and generate traffic through Twitter. It&#39;ll help you create tweetable quotes, add custom hashtags, shorten links, and make professional looking image tweets. With our plugin you&#39;ll be on your way to becoming an influencer on Twitter in no time at all.'),
(243, 'Mastery Hangout', 5, 44, 'Do you want to master the Google hangout tool so that you can appear more professional when hosting or attending hangouts? Our Hangout Mastery training program is the perfect tool for you! You\'ll get access to special training materials and access to our private G+ community who will provide direct feedback and help on your journey. Additionally, our G+ community will hold impromptu Q&amp; A training sessions that are designed to enrich your learning experience. We\'ll ensure that you have everything you need to make your Hangout events a success!'),
(244, 'FB Influence', 5, 44, 'Do you want to learn how to become an influencer on Facebook? We\'ll show you how to drastically increase traffic, leads, and sales. Our program will show you how to turn viewers into fans, fans into customers, and customers into advocates. You\'ll have access to all our incredible training modules as well as numerous bonus features like our stunning ready-made image quotes, our 3 step lead-generating blueprint, and our new \'members only\' training workshops. We\'ll ensure that you have everything you need to produce your own customized internet marketing strategy.'),
(245, 'Social Marketing Tribe', 5, 44, 'Social media is an incredible source of leads, traffic, and potential customers. You and your business can\'t ignore social media any longer, because there\'s nowhere else that you can reach such a large, captive audience just waiting to connect with you. We have marketing knowledge, keyword research, twitter traffic, LinkedIn ad training, Facebook Marketing, and others!'),
(246, 'Linked influence', 5, 44, 'Did you know that LinkedIn can revolutionize your business and your career? Don\'t waste your time aimlessly browsing this fantastic platform – take full advantage of it instead. Learn how you can drive profitable traffic to your website and business, how to market on a budget, even how to increase your profile\'s visibility with targeted keywords!'),
(247, 'Twitter Growth', 5, 44, 'Have you ever wanted to increase the number of followers on Twitter and boost the visibility of your business or brand? You\'ll learn about a magic system that\'ll help you find key influencers on Twitter and connect with them, as well as how to use automations and tools to increase your following, even when you\'re offline! Don\'t just dream about getting thousands of followers a month – learn how to actually do it!'),
(248, 'Periscope Profit Machine', 5, 44, 'Live streaming is taking off in a big way, and now you too can, we aim at teaching you all you need to know to successfully use the Periscope video streaming app and advance your business. You will learn everything from getting your first 1000 followers to writing catchy titles and building your brand on Periscope! Drive more hearts, shares and comments your way and profit from this course.'),
(249, 'Store PLR', 5, 44, 'Starting up your own business can be hard and time-consuming. Sure, you could buy a business in a box with private label rights included, but isn\'t that too confusing? And how can you be sure you\'re actually going to make any money? Your one-stop shop for businesses and income streams that will have you making money in no time at all! We will help you get one fantastic new business in a box every single month, with complete private label rights! This includes a complete Lead Generation system, and Front End and Upsell offers, all with the original raw files thrown in.'),
(250, 'Boom Social', 5, 44, 'Facebook doesn\'t just have to be your favorite place to hang out – it can also be a way to channel traffic and money to your business! Get More Likes, Shares, and Comments, we will teach you how to get the most out of Facebook and use it to advertise your own content, products,  or services! You\'ll learn how to create highly viral posts that will be shared and liked literally hundreds of thousands of times, and exactly what tools to use to create posts that are sure to blow up like crazy! Don’t waste money on outrageous advertising fees when you can promote your business all by yourself with the help of this video training course!'),
(251, 'Screenflow Edit', 5, 45, 'Do you want to learn how to create and edit videos smarter and faster? We will show you how to make amazing videos that\'ll sell products for you 24/7. My ScreenFlow Edit is designed to teach you to make great\' eye-catching videos in just 60 minutes. You\'ll learn everything you need to know to make interesting and professional video content for your business and marketing needs.'),
(252, 'Insights', 5, 45, 'Do you want to learn how to produce high quality business and marketing videos? The Course is designed to help you grow your business FAST. With our program you\'ll get access to live coaching Q&amp; A sessions, our private Facebook group, our member directory, our forms and templates, customer service, and much more! We\'ll provide you with everything you need to become a successful video producer and marketing professional.'),
(253, 'Marketing Insider', 5, 45, 'Video marketing is a gold mine for online businesses, and now you can learn all you need to know to exploit it ! We provide access to all the latest moneymaking videomarketing strategies, including tricks and techniques for selling with video, driving traffic to your website, outsourcing your videos, and even organizing webinars. This step-by-step program will help you get started in the world of video marketing even if you\'ve never made a video in your life, and it\'ll also teach you expert strategies for marketing on YouTube that\'ll benefit even the hardened video marketing pros.'),
(254, 'Give the Dog a Bone', 5, 2, 'If you\'re looking to break into a fun, lucrative, and ever growing industry, consider the pet industry! Learn how to generate obscene amounts of income from creating your own pet treat or pet nutrition business with \'Give the Dog a Bone\' the complete guide to starting and maximizing profit from a pet treat business. Recession-proof your wallet and become successful in one of the most fun industries around. Get the \'Give the Dog a Bone\' business system, today and build your future.'),
(255, 'Cover Letter Creator', 5, 2, 'Are you consistently getting passed over for interviews? Maybe the problem lies not with your qualifications, but with your cover letter. Job hunting authority can help you formulate a cover letter than gets you noticed and in the door. The customized high-powered cover letters found in “Cover Letter Creator” can help you instantly create a successful cover letter in almost any email or word program. Avoid the mistakes 98.7% of candidates are making and find out how to get noticed with a masterly crafted cover letter.'),
(256, 'Online Membership Club', 5, 2, 'If you\'re tired of spending hours crafting a presentation or email only to have it go over like a lead balloon, stop it right now. Let this five-month program kick your sales into overdrive and set you up for the promotion you deserve. You\'ll explore how to get more sales, effective networking, increasing your workflow efficiency, creating mind-blowing presentations, and concocting terrific proposals and more. This video program will give you the skills and confidence to take your business and career to the next level. Invest in yourself, and you\'ll reap rewards for your whole lifetime.'),
(257, 'Video Course', 5, 46, 'Sign up for the video course and learn about a little-known options trading strategy that can make you money whether the market is going up or down. Sounds too good to be true? It\'s not! You just don\'t have the secret yet. The gamma scalping strategy thrives in volatile markets, so if you like exciting, high yield trading, then this strategy is for you. With your purchase, you\'ll get access to nine online videos, taking you from novice to expert in no time at all. Order now and get a bonus set of thirty five videos detailing the basics of income straddle options—the perfect companion to gamma scalping. Start your journey now!'),
(258, 'Night Owls', 5, 46, 'Do you want access to a transparent, state of the art Binary options trading room? Then become a member of Night Owls and gain access to market trading sessions with up-to-date screens and comprehensive information on that session\'s winners and losers. Night Owl Signals is more than just a trading room, we want to help you rediscover the joy of trading again and give you the tools to do just that. Give us a try and find out why we are rated number one in the world; you\'ll be glad you did!'),
(259, 'Microcaps Millionaires', 5, 47, 'Opportunities like this don\'t just pop up every day! If you want to maximize your profits overnight and build some serious wealth, then you need the \'Once in a Decade\' stock pick video report. Shed some light on your portfolio and maximize your return with this great advice that will show you how to identify stocks that are about to explode! Don\'t just succeed in the short term, employ these strategies you can glean in a 13-minute video for the long run and see big returns. Start building your future today!'),
(260, 'Trading Addicts', 5, 47, 'Join the Trading Addicts trading community today, and start getting the support and profits you deserve. With your subscription, you get access to an exclusive trading room and webinar, an extensive informational library and knowledge bank to build your understanding and answer questions, and a passionate community willing to help you. With this tool kit, you can start turning terrific profit now. It\'s better if we win together, and we can with the Training Addicts community. Join today and see what all the ruckus is about.'),
(261, 'Dividened Stocks', 5, 47, 'Are you tired of trawling list after list of dividend stocks to find ones that\'ll maximize your profit? Well your search is over. Become a member of Dividend Stocks Online and you\'ll get updated lists of the top one hundred dividend stocks. The stocks are drawn from a diverse  range of payoffs, so you can best customize your portfolio for your needs. Trust the experts, become a member of Dividend Stocks Online, and watch your bank account grow!'),
(262, 'Up Down Signals', 5, 47, 'Whether you\'re new to binary options trading or a veteran, you can benefit from an Up Down Signals subscription. With ten minutes of your time at 11:30 am Eastern Standard Time and our signals subscription, you can be making real cash, real time. Get signals for both one hour and three hours. You know you can rely on us as we have a completely transparent trading history, and always feel you can reach out as we offer help and support to all members. What have you got to lose, subscribe to Up Down Signals today.'),
(263, 'Trading Master Plan', 5, 47, 'If you want to get serious with your trading, you\'ll need the Trading Master Plan. The Trading Master Plan is an informative comprehensive class designed to equip you with not only the knowledge but also the tools to make the most of your trading. In addition to the basics, you\'ll also learn eight dynamic buys and sell setups that will have you raking in the profits in no time. All this an extra tools, extra training video tutorials, ebooks, and so much more. Get serious, and start making money!'),
(264, 'Power Stock Trades', 5, 47, 'Have you always wanted to get involved in trading stocks, but didn\'t know where to start? Are you tired of wading through technical manuals that leave your head spinning? The Foundations Beginner Stock Trading Course is right for you! Each module is designed with care in mind to communicate the essentials clearly and effectively. In just four modules, you\'ll go from complete beginner to confident trader, and if you aren\'t happy with your purchase, return it within 60 days for a full refund! What have you got to lose! Start trading your way to a better life.'),
(265, 'Dividened Stocks Rock', 5, 47, 'Take your investing to the next level with the Dividend Stocks Rock subscription. You\'ll not only get access to unique, clear advice on when and where to invest, you\'ll get access to dividend stocks lists, portfolios, an exclusive newsletter, and so much more. Knowledge is power; use that power to build wealth intelligently with your subscription. No gimmicky tricks here, the Dividend Stocks Rock method relies on the knowledge that a firm foundation is key to longterm success. Build your foundation today!'),
(266, 'EA Review', 5, 48, 'Do you want a FOREX platform that provides you with real detailed data that doesn\'t feed you fake ticks and outdated information? The Tick Data Suite is what you\'re looking for. It allows using tick data in Metareader 4 back-testing, lets you back-test with real, variable spread, lifts Metareader 4\'s 4GB size limitation, and prevents the deletion of FXT data files to save time when repeatedly back-testing the same period. These and many other features are immediately available for you to download when you buy the suite or sign up for our FREE 7 day trial.'),
(267, 'Forex Tradomg Made E-Z', 5, 48, 'If you\'re not seeing the results you\'re wanting from your foray into forex trading, then you need to join the \'Forex Trading Made E-Z\' video club. This club will help you achieve your highest profits ever, using clear language and valuable insight into forex trading. As part of the club, you get access to descriptions of past material, answers to your questions, Excel spreadsheet programs, an auto-update \'Oscar\' indicator, and so much more. What\'s holding you  back from making a positive change? Join the \'Forex Trading Made E-Z\' video club, and achieve your financial future.'),
(268, 'Floating Charts', 5, 48, 'Are you ready to take your trading to the next level? Start trading like a pro with Floating Charts Multi-Monitor Support for MT4. You’ll have seamless UX complete with quick access chart toolbars, symbol mapping, keyboard shortcuts, one-time installation for multiple platforms and so much more. You\'ll also get lifetime support and automatic updates to ensure that you\'re never left in the dust. If you don\'t like it, return it within 60 days for a full refund, no questions asked. You’ve got nothing to lose, try Floating Charts today.'),
(269, 'Forex Trendy', 5, 48, 'Are you a forex trader who is tired of reading boring eBooks or downloading disappointing, buggy software that doesn\'t do the job? Then you should consider joining the Forex Trendy Membership area. We do all the analysis for you, and you can sign up for audible or email alerts so you can stay ahead of the curve. Why bog down your computer with complicated software or spend hours piecing together a strategy from a boring text book. Simply sign up, and up-to-date trend information is yours to profit from! Realize the financial future of your dreams.'),
(270, 'Forex Mentor Pro', 5, 48, 'If you\'re not seeing the results you want from your Forex trading experience, then you need Forex Mentor Pro, a time-tested subscription and mentoring program. Not only will you gain access to a comprehensive training course, you\'ll receive our video analysis coaching program, tools and systems, and a private forum so you can get real-time solutions to your real-time problems. We can all win together, so put your fear behind you and get some real help on your side. You can make it as a Forex trader; we believe in you!'),
(271, 'Forex CandleSticks', 5, 48, 'Whether you\'re a Forex trading beginner or veteran, this book can help you. Stop losing money to hunches that turn out to be false alarms or early panic and, instead, learn to decipher Forex candlesticks. \'Forex Candlesticks Made Easy\' is THE simple guide to understanding this crucial component of Forex trading. It\'s fast, easy to understand, and will revolutionize your trading practices. And if you aren\'t 100% satisfied, you\'ll get your money back. Trade in your past for your future!'),
(272, 'EA Builder', 5, 48, 'Do you have great hunches and trading ideas but wish there would be a way to implement your ideas into a cohesive strategy? Then you need EA Builder. With no programming background, you can create strategies to consistently implement your trading plans on the market, realtime. All it takes is a few clicks, and the program will do the rest. Eliminate costly mistakes and save valuable time. EA Builder is compatible with the three most popular trading platforms: MetaTrader 4, MetaTrader 5 and TradeStation and can trade any financial instrument. What’s stopping you? Start building your future now.'),
(273, 'FX Trend Setter', 5, 48, 'If you\'re in ForEx, then you need FX TrendCrusher, a proprietary software designed for the MetaTrader platform. FX TrendCrusher will slash the time you spend analysing ForEx markets, maximizing your profit. Don’t let the need to keep up to date keep you overwhelmed. Use FX TrendCrusher and start seeing the profits roll in with less effort than ever before. This program will not only save you time, it will increase your ability to make strategic and lucrative trades. You\'ve got nothing to lose, crush your losses and grab your gains, today.'),
(274, 'Forex Trading Made Easy', 5, 48, 'Are you tired of dishonest Forex trading schemes and want to really see your career take off? You need to consider investing in BlackEdge FX to get the accurate signals you need delivered the way you need them. You can have them delivered audibly, visually, or to your email inbox. You can also put puzzling your way through obtuse charts behind you with our clear, concise charts. Get the tools you need to succeed.'),
(275, 'Binary Signals', 5, 49, 'If you are new to binary trading, you need the Binary Signals subscription. You\'ll get up to three signals per day from Forex, commodities, stocks, and indices. You can make a 500% return in just one week by following our trades. When you subscribe, you\'ll work with real hedge fund traders with over 20 years of experience, so you can rest assured that you have experts on your side. With low limited risk and an average 75%-85% monthly success rate, trading with us is a win- win! Build wealth the easy way, sign up today.'),
(276, 'Fresh Drop', 5, 49, 'One of the best ways to make money on the internet is to buy and sell expired web domains, but who has time to check domain after domain, only to have it poached or find out it is useless! FreshDrop is a powerful database that not only has the most up-to- date reports on expire domains, but also gathers crucial information pertaining to the value of each domain. Simply search our database and bam, find the perfect domain to build, redirect, park, or sell. Access to our database is members-only, so get your key to the vault today!'),
(277, 'Auto binary Systems', 5, 49, 'The next generation of automated binary trading is here; don\'t miss out on this fantastic opportunity! You can be maximizing your profits in under fifteen minutes by downloading Auto Binary Signals software, trading the signals, and watch your bank account grow. Whether you\'re new to the market or a veteran, you\'ll be impressed at this fool-proof way to win! You don\'t need any trading experience to profit with this exclusive, customized signal software. Take it from the developer, who lost it all in \'87 and made it all back, this software will change your life. Download Auto Binary Signals today!'),
(278, 'Wealth Trigger', 5, 49, 'Get an insider look at a millionaire\'s mind and quickly learn the fastest, easiest way to wealth. A millionaire\'s success is based off the combination of 4 powers—mental, intuitive, emotional and soulful. Knowing how a millionaire thinks is just the first step; if you want to experience wild success you must begin to rapidly reprogram both your conscious and subconscious mind. Invest in yourself today and begin thinking like a millionaire.'),
(279, 'Wealthier Version of You', 5, 49, '\'Wealthier version of you\' shows you the absolute art of living a life with no loans, EMIs, interest payments etc. This is a step by step method of moving from &#39;Negative&#39; to &#39;Positive&#39; with proven strategies and system that generate PASSIVE INCOME with only experience investment for 10 minutes per day.'),
(280, 'Money Vibration', 5, 49, 'Who doesn\'t want to allow more money into their life? Especially when it\'s as easy as listening to music that has been specifically calibrated to align your energy with money. The real secret is that money has its own energy, and you have your own energy. In order to attract money, these energies need to match each other. In order to harness this energy (and in turn  attract more money), allow us to teach you how to change your vibration to match money through our hypnotic story.'),
(281, 'Basic Marketing Certification Online', 5, 50, 'Have you tried every business marketing seminar to no avail? Are you frustrated with shallow, simple marketing models that don\'t work? Then maybe you\'re missing the forest for the trees. See the forest again and become a certified holistic marketer! Most seminars miss crucial pieces of the puzzle, but marketing brings your whole person as a marketer into focus, and puts it to work for you. The entire seminar is online so you can say goodbye to costly flights and hotel stays. Instructor Steve Jones has years of experience in marketing and has put his broad knowledge bank to use for himself, and now for you! Join today.'),
(282, 'The Best Hour Marketing Break Through', 5, 50, 'If you\'ve got time for lunch, and who doesn\'t, then you\'ve got time for the \'Best Hour Marketing Breakthrough\' sales guide and template. This simple, three part plan is proven to boost sales in any industry, and boosting sales means boosting your career! Users have implemented the plan in the fields of menswear, politics, software, and natural horse care, and so many more. Invest in your future today, and start seeing results.'),
(283, 'Retirement Project', 5, 51, 'Have you ever wished there was a training manual for retirement? You\'ve spent years of your life working and…now what? If you have questions, financial or otherwise you need the \'Naked Retirement\' book bundle. This bundle of five books explores a range of topics from mental health, social life, financial planning and so much more. Don\'t just retire, live and buy the \'Naked Retirement\' bundle today.'),
(284, 'Turn Key Flyers', 5, 52, 'If you\'re tired of spending valuable time designing real estate flyers for your business, only to have them fall flat, then you need Turn-Key Flyers templates. These templates are professional, eye-catching, and easy to customize for any project. They are compatible with both Mac and Windows OS, so you don\'t have to worry about wasting your money. Stop wasting time and get your properties on the market STAT, and let Turn-Key Flyers help!'),
(285, 'Bird Dog Bot', 5, 52, 'Real Estate Finding Software: Learn about the best new opportunity in Real Estate deals. Customize and automate your real estate searches with BirdDogBot. You\'ll get to analyze deals without spending hours working through complicated math, and new deals are automatically sent to your inbox for your convenience. But that\'s not all, build buyers lists and share deals with other dealers to broaden and strengthen your network! You can search manually through BirdDogBot or you can set it to run searches automatically. With all of these benefits, what have you got to lose. Get BirdDogBot today.'),
(286, 'Virtual Fitness Blueprint', 5, 53, 'Whether you\'re new to the fitness industry or are a veteran, you can benefit from the Virtual Fitness Mastermind method! Do you want to maximize your benefits and learn from the successes of others? The Virtual Fitness Blueprint is a vault of systems and shortcuts specializing in helping your fitness company succeed. Learn how to market your product and successfully design campaigns. Take your fitness business to the next level and gain invaluable network connections. Invest in the Virtual Fitness Blueprint today.'),
(287, 'Profits', 5, 53, 'Turn your knack for crafting into a stable and lucrative business with the Profits guide to starting your own woodworking business. You can start your business with under $1000 starting capital and be making $90,000-$150,000 per year! Let expert worker lead you to success. This is a stable, non-volatile industry, so you can be making these profits from the comfort of your own home and with your own hands. Get back to the olden times and make good money doing it! Get your copy of the Profits guide today.'),
(288, 'Guide to Setting up a Low Pressure Washer', 5, 53, 'Do you want to turn your passion for creation into a lucrative business? Get this revolutionary book and learn how to create versatile low pressure, high pressure, and roof-cleaning washing systems all in one powerful rig. You’ll also learn other great tips for running your cleaning business smoothly and how to avoid using damaging chemicals while still getting your clients property cleaner than the other guy. The roof and power spray-cleaning industry will never go away, so learn from the best and start building your successful business, for less.'),
(289, 'Success', 5, 53, 'Do you want to make $4000 a month with only eight working hours per week? Does that sound impossible to you? Well it\'s not,only if you know how to use it properly. With the \'Success\' complete guide, you can learn about the most in- demand skills, how to market and expand your network, how to outsource tasks effectively, and how to fast-track your way to being a top-rated seller. If you want to become adept at navigating a fast-paced and lucrative marketplace.'),
(290, 'Instant Office Cleaning Kit', 5, 53, 'Clean up the competition with this unique, complete guide to starting and running a successful office cleaning business. You can be making tens of thousands of dollars working part-time in this lucrative, durable industry. The Instant Office Cleaning Kit gives you all the information you need to know to break into the industry or improve your existing model. For as long as people are around, they\'ll need cleaners, so you never have to worry about your business losing popularity. Start imagining what you\'ll be doing with all that extra money, and invest in the Instant Office Cleaning Kit today.'),
(291, 'Fast-Track Life Coaching', 5, 53, 'Have you benefited from a life coach? Has the field always made your ears perk up? Are you interested in being involved in a lucrative, fast-paced, fun industry? If you answered yes to any of these questions, you\'re a perfect candidate for Fast-Track Life Coaching Certification! Through this informative, life-changing course, you\'ll become a certified life coach! Get trained to change other people\'s lives, and get paid handsomely to do it, too! You can have the best of both worlds: helping people and making money. Start your journey today.'),
(292, 'Freight Broker\'s camp', 5, 53, 'Are you interested in becoming a freight broker? Freight brokers help the shipping world go \'round\' by helping broker deals between clients and shippers for lower costs. Not  only are you helping others, as a freight broker, you earn anywhere between $100 –$500 per shipment. Yes, that\'s per shipment. Be warned, this job is for those curious about the world, because you\'ll be learning about different industries and their needs every day. Learn how to get in the Freight Brokering business with our exclusive, comprehensive online training course, today! Your future will thank you.');
